package com.les.util;

import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;

import Decoder.BASE64Decoder;
import Decoder.BASE64Encoder;

public class Base64 {
	/**
	 * 加密
	 * 
	 * @param imgFile
	 *            图片路径
	 * @return
	 */
	public static String GetImageStr(String imgFile) {
		InputStream in = null;
		byte[] data = null;
		// 读取图片字节数组
		try {
			File file = new File(imgFile);
			if (!file.exists()) {
				return "";
			}
			in = new FileInputStream(imgFile);
			data = new byte[in.available()];
			in.read(data);
			in.close();
		} catch (IOException e) {
			e.printStackTrace();
			return "";
		}
		// 对字节数组Base64编码
		BASE64Encoder encoder = new BASE64Encoder();
		String encodeStr = encoder.encode(data);
		encodeStr = encodeStr.replaceAll("\r\n", "");
		return encodeStr;// 返回Base64编码过的字节数组字符串
	}

	/**
	 * 解密 
	 * @param imgStr 编码过的字符
	 * @param desFilePath 要生成的目标文件
	 * @return
	 */
	public boolean GenerateImage(String imgStr,String desFilePath) {
		if (imgStr == null) { // 图像 数据为空
			return false;
		}
		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64解码
			byte[] b = decoder.decodeBuffer(imgStr);
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {// 调整异常数据
					b[i] += 256;
				}
			}
			// 生成jpg图片
			OutputStream out = new FileOutputStream(desFilePath);
			out.write(b);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}

	public static byte[] GenerateImageByte(String imgStr) {
		if (imgStr == null) { // 图像 数据为空
			return null;
		}
		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64解码
			byte[] b = decoder.decodeBuffer(imgStr);
			return b;
		} catch (Exception e) {
			return null;
		}
	}
	
	public static void main(String args[]) {
		Base64 base64 = new Base64();
		String str = base64.GetImageStr("e:\\XYDJ0100170504002.pdf");
		System.out.println(str);
		System.out.println(str.length());
		System.out.println(str.length() % 4);
		
		String str1 = "";
//		System.out.println(str1.length());
//		System.out.println(str1.length() % 4);
		byte[] b = base64.GenerateImageByte(base64.GetImageStr("e://1.pdf"));
		System.out.println(b);
	}
}
